gPw(){return"The Longest Man-Made"},
gPv(){return"Structure in the World"},
gPx(){return"Its historic and strategic importance is matched only by its architectural significance."},
gPy(){return"UNESCO"},
gPm(){return"The best-known sections of the wall were built by the Ming dynasty (1368-1644)."},
gPn(){return"During the Ming dynasty, however, bricks were heavily used in many areas of the wall, as were materials such as tiles, lime, and stone."},
gPC(){return"\u201cSee China\u2019s Iconic Great Wall From Above | National Geographic.\u201d Youtube, uploaded by National Geographic."},
gPu(){return"Map showing location of Great Wall of China in northern China."},
gPq(){return"The Great Wall of China is a series of fortifications that were built across the historical northern borders of ancient Chinese states and Imperial China as protection against various nomadic groups from the Eurasian Steppe. The total length of all sections ever built is over 13,000 miles."},
gPr(){return"Several walls were built from as early as the 7th century BCE, with selective stretches later joined together by Qin Shi Huang (220-206  BCE), the first emperor of China. Little of the Qin wall remains. \nLater on, many successive dynasties built and maintained multiple stretches of border walls."},
gPo(){return"Transporting the large quantity of materials required for construction was difficult, so builders always tried to use local resources. Stones from the mountains were used over mountain ranges, while rammed earth was used for construction in the plains. Most of the ancient walls have eroded away over the centuries."},
gPp(){return"Stones cut into rectangular shapes were used for the foundation, inner and outer brims, and gateways of the wall. \nUnder the rule of the Qing dynasty, China's borders extended beyond the walls and Mongolia was annexed into the empire, so construction was discontinued."},
gPs(){return"Sette pianeti come tutti i possibili aspetti della divinit\xe0. Nella simbologia cristiana sette \xe8 il numero dei peccati capitali. Il sette domina la simbologia nell'Apocalisse del Vangelo di Giovanni. In Egitto era il simbolo della vita eterna, nel ritmo settenario segnava il passaggio di dei e mortali, attraverso sette sale e sette porte, e conduceva alle alte sfere. In Grecia il settimo giorno era consacrato ad Apollo. Ma sette \xe8 anche il numero della iniziazione femminile nella leggenda del Graal, dove troviamo sette fanciulle difese da sette cavalieri. Nella cultura ebraica la Menorah, il candeliere sacro, ha sette bracci. Il sette \xe8 appunto simbolo e agente di una funzione evolutiva come la creazione, e nel Vecchio e Nuovo Testamento si contemplano sei estensioni pi\xf9 il centro, come movimenti direzionali dello sguardo per la completa costruzione del mondo. Sette cieli ha l'Islam, sette giri bisogna compiere intorno alla Mecca. Sette profeti per i Sufi che sono associati ad altrettanti colori:nero opaco, blu, rosso, bianco, giallo, verde, nero brillante. Le opere esposte, in forma di pannelli strutturati in scalinate rimandano ad una strutturata lettura della simbologia sapienziale della scala La scala \xe8 la via di comunicazione fra terra e cielo (il sogno di Giacobbe nella Genesi). La scala \xe8 anche il percorso dell'evoluzione e della ascensione dal mondo materiale alla sfera immateriale della conoscenza spirituale.Nel Programma pedagogico medioevale e nel rito massonico scozzese ogni gradino corrisponde ad una rispettiva \"arte\" che l'iniziato deve scalare. Il saggio deve sapere salire i gradini, ma deve anche saperli discendere. La scalinata la troviamo presente nell'antico Egitto e nelle Piramidi Incas, Maya e Azteche. Anche i templi buddisti hanno forma di scalinate. Nel gioco libero della simbologia, Floriana Celani non dimentica l'importanza dei colori: Rosso, Bianco, Nero e Giallo presso i Maya e presso gli antichi Cinesi corrispondevano (differentemente) ai punti cardinali. L'argento collega alla Luna, \"bianca escrezione degli dei\" dell'antico Messico, e protegge dai demoni. L'oro, escremento del Dio Sole presso gli Aztechi. L'oro \xe8 simbolo del compimento dell'opus. Il fondo oro delle icone bizantine indica la luce divina. Nell'antica Cina la dialettica fra Yin e Yang si rispecchia fra argento e oro."},
gPt(){return"Apart from defense, other purposes of the Great Wall have included border controls, allowing the imposition of duties on goods transported along the Silk Road, regulation or encouragement of trade and the control of immigration and emigration."},
gPj(){return"First landmark of the Great Wall began originally as a square wall surrounding the state of Chu. Over the years, additional walls would be built and added to it to expand and connect territory."},
gPg(){return"The first Qin Emperor unifies China and links the wall of the surrounding states of Qin, Yan, and Zhao into the Great Wall of China, taking 10 years to build with hundreds of thousands of laborers."},
gPe(){return"A 20-year construction project was started by the Han emperor to build east and west sections of the wall, including beacons, towers, and castles. Not just for defense, but also to control trade routes like the Silk Road."},
gPh(){return"The Bei Qi kingdom also launched several construction projects, utilizing over 1.8 million workers to repair and extend sections of the wall, adding to its length and even building a second inner wall around Shanxi."},
gPi(){return"The Great Wall was repaired during the Sui Dynasty and used to defend against Tujue attacks. Before and after the Sui Dynasty, the wall saw very little use and fell into disrepair."},
gPf(){return"Hongzhi Emperor split the walls into north and south lines, eventually shaping it into how it is today. Since then, it has gradually fallen into disrepair and remains mostly unused."},
