ga4J(){return"Cusco Region, Peru"},
ga4t(){return"Inca"},
ga4u(){return"South America"},
ga4G(){return"Few Romances Can Ever Surpass"},
ga4F(){return"That of the Granite Citadel"},
ga4E(){return"Hiram Bingham"},
ga4H(){return"In the variety of its charms and the power of its spell, I know of no other place in the world which can compare with it."},
ga4I(){return"Hiram Bingham"},
ga4v(){return"During its use as a royal estate, it is estimated that about 750 people lived there, with most serving as support staff who lived there permanently."},
ga4w(){return"The Incas were masters of this technique, called ashlar, in which blocks of stone are cut to fit together tightly without mortar."},
ga4M(){return"\u201cMachu Picchu 101 | National Geographic.\u201d Youtube, uploaded by National Geographic."},
ga4D(){return"Map showing location of Machu Picchu in the Eastern Cordillera of southern Peru."},
ga4z(){return"Machu Picchu is a 15th-century Inca citadel located in the Eastern Cordillera of southern Peru on a 2,430-meter (7,970 ft) mountain ridge. Construction appears to date from two great Inca rulers, Pachacutec Inca Yupanqui (1438\u20131471 CE) and T\xfapac Inca Yupanqui (1472\u20131493 CE)."},
ga4A(){return"There is a consensus among archeologists that Pachacutec ordered the construction of the royal estate for his use as a retreat, most likely after a successful military campaign.\nRather it was used for 80 years before being abandoned, seemingly because of the Spanish conquests in other parts of the Inca Empire."},
ga4x(){return'The central buildings use the classical Inca architectural style of polished dry-stone walls of regular shape. \nInca walls have many stabilizing features: doors and windows are trapezoidal, narrowing from bottom to top; corners usually are rounded; inside corners often incline slightly into the rooms, and outside corners were often tied together by "L"-shaped blocks.'},
ga4y(){return"This precision construction method made the structures at Machu Picchu resistant to seismic activity.\nThe site itself may have been intentionally built on fault lines to afford better drainage and a ready supply of fractured stone."},
ga4B(){return"Machu Picchu is situated above a bow of the Urubamba River, which surrounds the site on three sides, where cliffs drop vertically for 1,480 feet (450 m) to the river at their base. The location of the city was a military secret, and its deep precipices and steep mountains provided natural defenses."},
ga4C(){return"The Inca Bridge, an Inca grass rope bridge, across the Urubamba River in the Pongo de Mainique, provided a secret entrance for the Inca army. Another Inca bridge was built to the west of Machu Picchu, the tree-trunk bridge, at a location where a gap occurs in the cliff that measures 20 feet (6 m)."},
ga4n(){return"Speculated to be built and occupied by Inca ruler Pachacuti Inca Yupanqui."},
ga4o(){return"The last Inca rulers used the site as a bastion to rebel against Spanish rule until they were ultimately wiped out."},
ga4p(){return"Speculated to have been originally discovered by German explorer Augusto Berns, but his findings were never effectively publicized."},
ga4q(){return"Introduced to the world by Hiram Bingham of Yale University, who was led there by locals after disclosing he was searching for Vilcabamba, the \u2019lost city of the Incas\u2019."},
ga4r(){return"Surrounding sites were excavated thoroughly by Gene Savoy, who found a much more suitable candidate for Vilcabamba in the ruin known as Esp\xedritu Pampa."},
ga4s(){return"Since its rediscovery, growing numbers of tourists have visited the Machu Picchu each year, with numbers exceeding 1.4 million in 2017."},
