ga5S(){return"Half as Old as Time"},
ga5R(){return"John William Burgon"},
ga5U(){return"Petra is a brilliant display of man\u2019s artistry in turning barren rock into a majestic wonder."},
ga5V(){return"Edward Dawson"},
ga5I(){return"They were particularly skillful in harvesting rainwater, agriculture and stone carving."},
ga5J(){return"Perhaps a more prominent resemblance to Hellenistic style in Petra comes with its Treasury."},
ga5Z(){return"\u201cStunning Stone Monuments of Petra | National Geographic.\u201d Youtube, uploaded by National Geographic."},
ga5Q(){return"Map showing location of Petra in Ma\u2019an Governorate, Jordan."},
ga5M(){return"The area around Petra has been inhabited from as early as 7000  BCE, and the Nabataeans might have settled in what would become the capital city of their kingdom as early as the 4th century BCE.\nThe trading business gained the Nabataeans considerable revenue and Petra became the focus of their wealth. The Nabataeans were accustomed to living in the barren deserts, unlike their enemies, and were able to repel attacks by taking advantage of the area's mountainous terrain."},
ga5N(){return"Petra flourished in the 1st century CE, when its famous Al-Khazneh structure - believed to be the mausoleum of Nabataean king Aretas IV - was constructed, and its population peaked at an estimated 20,000 inhabitants.\nAccess to the city is through a 3/4 mile-long (1.2 km) gorge called the Siq, which leads directly to the Khazneh."},
ga5K(){return'Famous for its rock-cut architecture and water conduit system, Petra is also called the "Red Rose City" because of the color of the stone from which it is carved.\nAnother thing Petra is known for is its Hellenistic (\u201cGreek\u201d) architecture. These influences can be seen in many of the facades at Petra and are a reflection of the cultures that the Nabataens traded with.'},
ga5L(){return"The facade of the Treasury features a broken pediment with a central tholos (\u201cdome\u201d) inside, and two obelisks appear to form into the rock of Petra at the top. Near the bottom of the Treasury we see twin Greek Gods: Pollux, Castor, and Dioscuri, who protect travelers on their journeys. \nNear the top of the Treasury, two victories are seen standing on each side of a female figure on the tholos. This female figure is believed to be the Isis-Tyche, Isis being the Egyptian Goddess and Tyche being the Greek Goddess of good fortune."},
ga5O(){return"Petra is located in southern Jordan. It is adjacent to the mountain of Jabal Al-Madbah, in a basin surrounded by mountains forming the eastern flank of the Arabah valley running from the Dead Sea to the Gulf of Aqaba."},
ga5P(){return"The area around Petra has been inhabited from as early as 7000 BC, and the Nabataeans might have settled in what would become the capital city of their kingdom as early as the 4th century BC.\nArchaeological work has only discovered evidence of Nabataean presence dating back to the second century BC, by which time Petra had become their capital. The Nabataeans were nomadic Arabs who invested in Petra's proximity to the incense trade routes by establishing it as a major regional trading hub."},
ga5B(){return"First Edomites occupied the area and established a foothold."},
ga5A(){return"Became part of the Roman province Arabia"},
ga5F(){return"After being damaged by earthquakes, habitation of the city all but ceased."},
ga5C(){return"Rediscovered by the Swiss traveler Johann Ludwig Burckhardt."},
ga5D(){return"Excavations led on the site by the British School of Archaeology and the American Center of Oriental Research."},
ga5E(){return"Appeared in the film Indiana Jones and The Last Crusade."},
